import styled from "styled-components";


export const Menu = styled.div`


    width: 50px;
    height: 50px;
    border-radius: 10000px;
    background-color: #eee;

    img{
        width: 50px;
        height: 50px;
        border-radius : 10000px;
        cursor: pointer;
    }


`

export const DropDownMenu = styled.div` 

    position: relative;
    top: 0;
    right: 90px;
    background-color: #eee;
    width: 150px;




`
